# Extend the topology to include the cloud-hosted Mac server
nodes.update({
    "Cloud Mac Server": {"color": "gray", "shape": "s"}
})

edges.append(("Cloud Mac Server", "UDM Pro"))  # Securely connecting to local network

# Update positioning for better visualization
pos.update({
    "Cloud Mac Server": (5, 2)
})

# Rebuild the graph with the new Cloud Mac connection
G.clear()

for node, props in nodes.items():
    G.add_node(node, color=props["color"], shape=props["shape"])

for edge in edges:
    G.add_edge(*edge)

# Draw the updated topology with the cloud-hosted Mac
plt.figure(figsize=(12, 7))
node_colors = [nodes[node]["color"] for node in G.nodes]

nx.draw(G, pos, with_labels=True, node_size=3000, node_color=node_colors, edge_color="black", font_size=10, font_weight="bold")

# Display VLANs separately
for vlan, devices in {**vlans, **home_vlans}.items():
    subgraph = G.subgraph(devices)
    nx.draw(subgraph, pos, node_size=3000, edge_color="gray", alpha=0.6, node_color="yellow")

plt.title("Updated Network Topology with Cloud Mac Server")
plt.show()

